import React, {useEffect, useState} from "react";
import {useParams} from "react-router-dom";
import axios from "axios";
export function ViewOrdersToDeliveryBoy(){
    const [avaOrd , setAvaOrd] = useState([])
    const params= useParams()
    const [loc, setLocation] = useState()
    const getData = () =>{
        let token=JSON.parse(window.localStorage.getItem('Token'))
        axios.get("http://localhost:9087/delivery/viewordersatdeliverylocation/"+params.pincode,{
            headers: {'Authorization' : 'Bearer '+token,
                'Access-Control-Allow-Origin': '*'}
        } )
            .then(response => {
                console.log(response)
                setAvaOrd(response.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    useEffect(()=>{
        getData()
    },[])
    return(
        <>
                {
                    avaOrd.length>0
                        ? avaOrd.map((item)=>
                            <div className="card">
                                {item.address.area} , {item.address.city} {item.address.state} {item.address.pincode}<br/>
                                {item.customer.name} , {item.customer.phone},  {item.customer.email} <br/>
                                {item.partner.storeName} , {item.partner.storeLoc} ,{item.partner.contactno} {item.partner.email}<br/><br/>
                                <button type="submit">Pick</button>
                            </div>
                        )
                        :""
                }

        </>

    )
}
